const MultiStepIndicator = ({}) => {
  return (
    <nav>
      <ol className="cd-multi-steps text-top">
        <li className="visited"><a href="#0">Seus dados</a></li>
        <li className="visited"><a href="#0">Planos</a></li>
        <li className="current"><em>Pagamento</em></li>
        <li><em>Review</em></li>
      </ol>
    </nav>
  )
}


export default MultiStepIndicator
